export function Ticker ({
  ticker,
  exchange,
  price,
  change,
  change_percent
}) 
{
  return (
    <div>
      <p>Name: {ticker}</p>
      <p>Stock: {exchange}</p>
      <p>Price: {price}</p>
      <p>Change: {change}</p>
      <p>%: {change_percent}</p>
    </div>
  )
}
